import '../styles/ExpenseItem.css';

function ExpenseItem() {
    return (
        <div >
            <div>2023년 6월 27일</div>
            <div>
                <h2>Car Insurance </h2>
                <div>$200.23</div>
            </div>
        </div>
    )
}

export default ExpenseItem;
